import './index.css';
import { useDispatch } from "react-redux";
import { useEffect } from "react";
import ShiftsForm from "./shiftsForm";
import TravelDistanceForm from "./travelDistanceForm";
import PreferredDaysForm from "./preferredDaysForm";
import CovidForm from "./covidForm";
import { getMasterData } from './action';
import useConfiguration from "../../../hooks/useConfiguration";

export default () => {
    const dispatch = useDispatch();
    const config = useConfiguration();
    useEffect(() => {
        config.baseUrl && dispatch(getMasterData(config.baseUrl));
    }, [config]);
    return (
        <div id="step-12" className="tab-pane step-content block-display">
            <form>
                <ShiftsForm />
                <TravelDistanceForm />
                <PreferredDaysForm />
                <CovidForm />
            </form>
        </div>
    )
}
